			int_ui.children.actions.children.adder.add("enabled", true);
			int_ui.children.actions.children.adder.enabled = false;
			ui.add("addfile", null);

			var setaddfile = function(k, v) {
				int_ui.children.actions.children.adder.enabled = (v != null);
